//SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;

import "./interfaces/ITuitionContract.sol";
import "./interfaces/IAccessControl.sol";

contract TuitionContract is ITuitionContract {
    using SafeERC20 for IERC20;

    address public immutable owner;
    Tuition public tuition;
    Status public status = Status.Lock;

    address public UITToken;
    IAccessControl public accessControll;
    address public rewardDistributor;

    address[] public participants;
    uint256 public amount;
    mapping(address => uint256) public participantToIndex;
    mapping(address => bool) public participantToTrue;
    mapping(address =>bool) public completedAddress;

    modifier onlyLock() {
        require(status == Status.Lock, "MC: Only Lock");
        _;
    }

    modifier onlyOpen() {
        require(status == Status.Open, "MC: Only Open");
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only Owner");
        _;
    }

    modifier onlyRoleAdmin() {
        require(
            accessControll.hasRole(keccak256("ADMIN"), msg.sender),
            "MC: Only Lecturer"
        );
        _;
    }

    modifier onlyRoleStudent() {
        require(
            accessControll.hasRole(keccak256("STUDENT"), msg.sender),
            "MC: Only Student"
        );
        _;
    }

    constructor(
        address _owner,
        address _accessControll,
        address _rewardDistributor
    ) {
        owner = _owner;
        accessControll = IAccessControl(_accessControll);
        rewardDistributor = _rewardDistributor;
    }

    function setBasicForTuition(
        uint256 _tuitionId,
        string memory _urlMetadata,
        uint256 _feeByToken,
        uint256 _startTime,
        uint256 _endTime
    ) external override onlyOwner onlyLock {
        require(_feeByToken > 0, "MC: Award should greater than Zero");
        require(
            block.timestamp < _startTime && _startTime < _endTime,
            "MC: Time is invalid"
        );

        tuition = Tuition(
            _tuitionId,
            _urlMetadata,
            _feeByToken,
            _startTime,
            _endTime
        );
    }

    function start() external override onlyOwner onlyLock {
        status = Status.Open;
    }

    function addStudentToTuition(address[] calldata _students)
        external
        override
        onlyRoleAdmin
        onlyOpen
    {
        for (uint256 i = 0; i < _students.length; i++) {
            require(accessControll.hasRole(keccak256("STUDENT"), _students[i]), "Should only add student");
            require(!participantToTrue[_students[i]], "Added");
            participants.push(_students[i]);
            participantToIndex[_students[i]] = participants.length - 1;
            participantToTrue[_students[i]] = true;
            amount++;
        }
    }

    function removeStudentFromTuition(address _student) external onlyRoleAdmin {
        require(participantToTrue[_student], "Error when remove");
        uint256 index = participantToIndex[_student];
        amount--;
        participantToTrue[_student] = false;
        delete participants[index];
    }

    function paymentByToken() external override onlyRoleStudent {
        require(!participantToTrue[msg.sender], "TC: You paid tuition");
        IERC20(UITToken).safeTransferFrom(
            msg.sender,
            rewardDistributor,
            tuition.feeByToken
        );
        completedAddress[msg.sender] = true;
        emit Payment(msg.sender, block.timestamp, PaymentMethod.Token);
    }

    function paymentByCurrency(address student)
        external
        override
        onlyRoleAdmin
    {
        require(!participantToTrue[student], "TC: Student paid tuition");
        completedAddress[msg.sender] = true;
        emit Payment(student, block.timestamp, PaymentMethod.Currency);
    }

    function close() external override onlyOwner {
        status = Status.Close;
        emit Close(block.timestamp);
    }

    function getParticipantList() public view override returns (address[] memory) {
        address[] memory student = new address[](amount);
        uint256 index;
        for (uint256 i = 0; i < participants.length; i++) {
            if (participantToTrue[participants[i]] && participants[i] != address(0)) {
                student[index] = participants[i];
                index++;
            }
        }
        return student;
    }

    function getParticipantListCompleted()
        public
        view
        returns (address[] memory)
    {
        address[] memory student = new address[](amount);
        uint256 index;
        for (uint256 i = 0; i < participants.length; i++) {
            if (completedAddress[participants[i]]) {
                student[index] = participants[i];
                index++;
            }
        }
        return student;
    }
}

contracts/studentmanager/interfaces/IAcc.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.8.0;

interface IAccessControl {
    struct RoleData {
        mapping(address => bool) members;
        bytes32 role;
    }
    event RoleAdminChanged(
        bytes32 indexed role,
        bytes32 indexed previousAdminRole,
        bytes32 indexed newAdminRole
    );
    event RoleGranted(
        bytes32 indexed role,
        address indexed account,
        address indexed sender
    );
    event RoleRevoked(bytes32 indexed role, address indexed account);

    function hasRole(bytes32 role, address account)
        external
        view
        returns (bool);

    function getRoleExist(bytes32 role) external view returns (bytes32);

    function grantRole(bytes32 role, address account) external;

    function revokeRole(bytes32 role, address account) external;

    function renounceRole(bytes32 role) external;

    function addNewRoleAdmin(bytes32 role) external;

    function removeNewRoleAdmin(bytes32 role) external;
}

contracts/studentmanager/interfaces/ITui.content:
//SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface ITuitionContract {
    struct Tuition {
        uint256 Id;
        string urlMetadata;
        uint256 feeByToken;
        uint256 startTime;
        uint256 endTime;
    }

    enum Status {
        Lock,
        Open,
        Close
    }

    enum PaymentMethod {
        Token,
        Currency
    }

    event CreatedNewTuition(uint256 indexed id);
    event Payment(address student, uint256 timestamp, PaymentMethod _method);
    event Close(uint256 timestamp);

    function setBasicForTuition(
        uint256 _tuitionId,
        string memory _urlMetadata,
        uint256 feeByToken,
        uint256 _startTime,
        uint256 _endTime
    ) external;

    function start() external;

    function addStudentToTuition(address[] memory _students) external;

    function close() external;

    function paymentByToken() external;

    function paymentByCurrency(address student) external;

    function getParticipantList() external view returns (address[] memory);
}

